// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

contract demo {
    address public owner;
    constructor(){
        owner = msg.sender;
    }

    function avg(uint a,uint b) public pure returns(uint){
        if(b==0) return 0;
        else {
            avg(b,b%a);
        }
    }
}

